import React from "react";
import { useEffect, useState } from "react";
import { useParams } from 'react-router-dom';

function Detail(){

    const [ detalles, setDetalles ] = useState();

    const { id } = useParams();

    return (
        <div> {id} </div>
    )
}

export default Detail;
